import React from 'react';
import Conversation from '../components/Conversation';
import './spotify.scss';

function NavCard(props: any) {
    const [clicked, setClicked] = React.useState(""); 

    function handleClick(event: any) {
        props.onChildClick(event.target.name); // pass any argument to the callback
    }

    return(
        <div className={`nav-card${props.clicked ? "-clicked": ""}`} onClick={handleClick}>
            <div className="icon">

            </div>
            <h5>Home</h5>
        </div>
    )
}

function NavBar(props: any) {
    const [clicked, setClicked] = React.useState(""); 

    function handleChildClick(navItem: string) {
        setClicked(navItem);
    }

    const navbarItems = ["Home", "Search", "Your Library"];
    console.log(clicked);

    return(
        <div className="navbar">
            <NavCard navItem={"Home"} clicked={clicked === "Home"}/>
            <NavCard navItem={"Search"}  clicked={clicked === "Search"}/>
            <NavCard navItem={"Your Library"} onClick={() => setClicked("Your Library")} clicked={clicked === "Your Library"}/>
        </div>
    )
}


export default function Spotify(props: any) {
    const [ selected, setSelected ] = React.useState(null);

    function handleChildClick(childData: any) {
        setSelected(childData);
    }

    console.log(selected);
    const examples = [];
    for (var i = 0; i < 60; i++) {
        examples.push(i);
    }

    return(
        <div className="spotify-container">
            <div className="left-sidebar">

                <div className="header">
                    <div className="button-container">
                        <div className="button close"></div>
                        <div className="button minimize"></div>
                        <div className="button expand"></div>
                    </div>
                </div>

                <NavBar/>

                <div className="playlists"> 
                    {examples.map(() => {
                        return(
                            <div className="playlist">
                                <p>late night studying</p>
                            </div>
                        )
                    })}
                </div>
            </div>

            <div className="spotify-main">

            </div>

            <div className="right-sidebar">
                <div className="header">

                </div>
            </div>
        </div>
    )
}


function Sidebar(props: any) {

    return(
        <div className="spotify-sidebar">

        </div>
    )
}
